member.summary:
The look at.
The look at element contains a position and orientation transformation suitable for aiming a camera.
The look at element contains three mathematical vectors within it that describe:
1. The position of the object;
2. The position of the interest point;
3. The direction that points up.

member.example:
In this example, an attempt will be made to find a license file named MyLicense.lic
in the folder that contains 


the component, in the folder that contains the calling assembly,
in the folder of the entry assembly and then in the embedded resources of the calling assembly.

